import React from 'react';
import {
    Nav,
    NavLink,
    Bars,
    NavMenu,
    NavBtn,
    NavBtnLink,
} from './NavbarElements';
import clarisso from './coffee.jpg';

const Navbar = () => {
return (
	<>
	<Nav>
		<Bars />

		<NavMenu>
        <NavLink to='/' activeStyle>
        <img src ={clarisso} height = "50" width = "40" alt = "coffee"/> 
        <NavLink to='/' activeStyle>clarisso</NavLink>
		</NavLink>
		<NavLink to='/about' activeStyle>
			break
		</NavLink>
		<NavLink to='/events' activeStyle>
			weekly schedule
		</NavLink>
		<NavLink to='/annual' activeStyle>
			other
		</NavLink>
		<NavLink to='/team' activeStyle>
			other2
		</NavLink>
		<NavLink to='/blogs' activeStyle>
			stuff
		</NavLink>
		<NavLink to='/sign-up' activeStyle>
			ignore 2
		</NavLink>
		{/* Second Nav */}
		{/* <NavBtnLink to='/sign-in'>Sign In</NavBtnLink> */}
		</NavMenu>
        {/* 
		<NavBtn>
		<NavBtnLink to='/signin'>ignore</NavBtnLink>
		</NavBtn> */}
	</Nav>
	</>
);
};

export default Navbar;
